import { useState } from "react";

function LargeCube({ onFaceClick }) {


  return (
    <mesh rotation={[Math.PI / 6, Math.PI / 4, 0]} >
      <boxGeometry attach="geometry" args={[1.82, 1.82, 1.82]} wireframe={true}/>
      <meshBasicMaterial attach="material-0" color="#00FF00" wireframe={true}/>
<meshBasicMaterial attach="material-1" color="#2B00FF" wireframe={true}/>
<meshBasicMaterial attach="material-2" color="#CF8B8B" wireframe={true}/>
<meshBasicMaterial attach="material-3" color="#A9CE4A" wireframe={true} />
<meshBasicMaterial attach="material-4" color="#11EE0E"wireframe={true} />
<meshBasicMaterial attach="material-5" color="#DB0DE6" wireframe={true}/>
    </mesh>
  );
}
export default LargeCube;
